import React from 'react';
import './style.css';
import Card from '../../components/UI/Card';

/**
* @author
* @function Post
**/

const Post = (props) => {
  return(
   <section className="container">
    <Card className="blogpost">blogpost</Card>
    <Card className="sidebar">sidebar</Card>
   </section>
   )

 }

export default Post;
